script: |
  super -f text -I q3594.spq | sort > q3594.out

inputs:
  - name: q3594.spq
    data: |
      SELECT DISTINCT - 69 AS col2 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q3594.out
    data: |
      -69
